export default function Footer() {
  return (
    <footer>
        <div className='footerBottom'> Copyright Handcraft Inc. 1986  &#160;   &#160;| &#160; &#160;  Website Design by 
            <a className='urlOfCreater' target="_blank" shape="rect" border="0" href="https://www.instagram.com/artem.feskov/"> @Artem Feskov</a>
        </div>
          
        
    </footer>
  )
}
